import React from 'react'
import CurrencyFormat from 'react-currency-format';
function Subtotal() {
    return (
        <div>
            
            <CurrencyFormat
            value={2456981} 
            displayType={'text'}
            thousandSeparator={true}
            prefix={'$'} 

            renderText={(value)=>{<div>`${value}`</div>}}


            />
        </div>
    )
}

export default Subtotal
